import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className="flex flex-wrap items-center justify-between w-screen bg-onxy-300">
                <div className="flex flex-row items-center justify-between px-2 py-4">
                    <a className="text-white font-bold">Created By<span className="text-blue-500 font-medium">Josi</span></a>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
